import React from 'react';
import './Contact.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faInstagram, faYoutube,  } from '@fortawesome/free-brands-svg-icons';
import img from '../../Assets/GW.jpg'

const Contact = () => {
  return (
    <section id='Contact' className='contact'>
      <div className='contact-form'>
        <h1>Contact<span className='contact-me'> Me</span></h1>
        <p>Contact me, I'm willing to take part in several collaborative projects together with the aim of developing skills.</p>
        <form>
          <input type='text' placeholder='Your Name' required />
          <input type='email' name='email' id='' placeholder='Your E-mail' required />
          <input type='' placeholder='Write a Subject' required />
          <textarea name='' id='' cols='30' rows='10' placeholder='Your Message' required />
          <input type='submit' name='' value='Send' className='BTN' />
          <div className="social-icons">
            <FontAwesomeIcon icon={faInstagram} size="lg" />
            <FontAwesomeIcon icon={faYoutube} size="lg" />
          </div>
        </form>
      </div>

      <div className='contact-img'>
        <img src={img} />
      </div>
    </section>
  );
}

export default Contact;
